import style from "./opis.module.css"
import img from "../../../img/восклиц.jpg"

export const MyOpisBlock = ({text}) => {
  return (
    <div className={style.tableOpis}>
        <img src={img} width="20px"/>
        <p>{text}</p>
    </div>
  )
}
